import React, { useState } from 'react'
import './Header.css'
import SearchIcon from "@material-ui/icons/Search";
import LanguageIcon from '@material-ui/icons/Language';
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';
import { Avatar } from '@material-ui/core';
import { Button } from "@material-ui/core";

function Header() {

  // keeps track of whether button is clicked
  const [showSearch, setShowSearch] = useState
  (true);

  return (
    <div className='header'>
      <img
        className = "header__icon"
        src = "https://i.pinimg.com/originals/54/ac/a8/54aca8a97eedbbcec06ec55a4f6bfe78.png"
        alt = ""
      />

      <div className='searchbar'>
        <input type='text' />
        <SearchIcon/>
        <div className='datesearch'> 
          {showSearch && <h3>Show Dates</h3> }
          <Button onClick={() => setShowSearch(!showSearch) }  className='datebutton' variant='outlined' > Book Dates </Button>
        </div>
      </div>

      <div
        className='header__right' >
          <p>Book your next trip</p>
          <LanguageIcon/>
          <ArrowDropDownIcon/>
          <Avatar/>

      </div>

    </div>
  )
}

export default Header
